documentation.text:
@title StakeYourName - NameManager
 @notice Maintains a list of users and names they want to keep renewed
 @notice Can check for name expiry and pay for renewals
 @author Daniel Chilvers

Sets the ABI associated with an ENS node.
Nodes may have one ABI of each content type. To remove an ABI, set it to
the empty string.
@param node The node to update.
@param contentType The content type of the ABI
@param data The ABI data.

Returns the ABI associated with an ENS node.
Defined in EIP205.
@param node The ENS node to query
@param contentTypes A bitwise OR of the ABI formats accepted by the caller.
@return contentType The content type of the return value
@return data The ABI data

Sets the address associated with an ENS node.
May only be called by the owner of that node in the ENS registry.
@param node The node to update.
@param a The address to set.

Returns the address associated with an ENS node.
@param node The ENS node to query.
@return The associated address.

Sets the contenthash associated with an ENS node.
May only be called by the owner of that node in the ENS registry.
@param node The node to update.
@param hash The contenthash to set

Returns the contenthash associated with an ENS node.
@param node The ENS node to query.
@return The associated contenthash.

Obtain a DNS record.
@param node the namehash of the node for which to fetch the record
@param name the keccak-256 hash of the fully-qualified name for which to fetch the record
@param resource the ID of the resource as per https://en.wikipedia.org/wiki/List_of_DNS_record_types
@return the DNS record in wire format if present, otherwise empty

Check if a given node has records.
@param node the namehash of the node for which to check the records
@param name the namehash of the node for which to check the records

Sets an interface associated with a name.
Setting the address to 0 restores the default behaviour of querying the contract at `addr()` for interface support.
@param node The node to update.
@param interfaceID The EIP 168 interface ID.
@param implementer The address of a contract that implements this interface for this node.

Returns the address of a contract that implements the specified interface for this name.
If an implementer has not been set for this interfaceID and name, the resolver will query
the contract at `addr()`. If `addr()` is set, a contract exists at that address, and that
contract implements EIP168 and returns `true` for the specified interfaceID, its address
will be returned.
@param node The ENS node to query.
@param interfaceID The EIP 168 interface ID to check for.
@return The address that implements this interface, or 0 if the interface is unsupported.

Sets the name associated with an ENS node, for reverse records.
May only be called by the owner of that node in the ENS registry.
@param node The node to update.
@param name The name to set.

Returns the name associated with an ENS node, for reverse records.
Defined in EIP181.
@param node The ENS node to query.
@return The associated name.

Sets the SECP256k1 public key associated with an ENS node.
@param node The ENS node to query
@param x the X coordinate of the curve point for the public key.
@param y the Y coordinate of the curve point for the public key.

Returns the SECP256k1 public key associated with an ENS node.
Defined in EIP 619.
@param node The ENS node to query
@return x , y the X and Y coordinates of the curve point for the public key.

Sets the text data associated with an ENS node and key.
May only be called by the owner of that node in the ENS registry.
@param node The node to update.
@param key The key to set.
@param value The text data value to set.

Returns the text data associated with an ENS node and key.
@param node The ENS node to query.
@param key The text data key to query.
@return The associated text data.
